import React from 'react';
import './MapPage.css';

const MapPage = () => {
    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', width: '100%' }}>
            <iframe
                src="https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d21.291925078561626!3d79.40819998954599!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
                width="100%"
                height="600"
                style={{ border: 0 }}
                allowFullScreen
                loading="lazy"
                referrerPolicy="no-referrer-when-downgrade"
            />
        </div>
    );
};

export default MapPage;
